    t[238] = "Allocate number of processor threads for building tunnels. If your processor supports hyperthreading or simultaneous multithreading, you may multiply the number of processor cores by 2 to get the maximum number of threads to allocate, otherwise number of processor cores = maximum number of threads available. Note that you may wish to allocate less than the theoretical maximum to ensure you have headroom for other tasks.";
    t[239] = "Assegna il numero di thread del processore per la costruzione dei tunnel. Se il tuo processore supporta l'iper-threading o il multithreading simultaneo, puoi moltiplicare il numero di core del processore per 2 per ottenere il numero massimo di thread da allocare, altrimenti il numero di core del processore = massimo numero di thread disponibili. Nota che potresti desiderare di assegnare meno del massimo teorico per assicurarti di avere margine di manovra per altre attivit\u00e0.";
