    t[622] = "A command-line application supplied with I2P that is used to request URL resources, similar to <a href=https://www.gnu.org/software/wget/ class='sitelink external' target=_blank rel=noreferrer>wget</a> or <a href=https://curl.haxx.se/ class='sitelink external' target=_blank rel=noreferrer>curl</a>. Eepget is also used internally by the router, for example to reseed from remote hosts. By default, eepget uses the HTTP proxy on <code>127.0.0.1:4444</code>.";
    t[623] = "Un'applicazione a riga di comando fornita con I2P che viene utilizzata per richiedere risorse URL, simile a <a href=https://www.gnu.org/software/wget/ class='sitelink external' target=_blank rel=noreferrer>wget</a> o <a href=https://curl.haxx.se/ class='sitelink external' target=_blank rel=noreferrer>curl</a>. Eepget \u00e8 anche utilizzato internamente dal router, ad esempio per eseguire un reseed da host remoti. Per impostazione predefinita, eepget utilizza il proxy HTTP su <code>127.0.0.1:4444</code>.";
