    t[723] = "Javadoc";
    t[724] = "An eepsite is a website that is hosted anonymously on the I2P network - you can access it by configuring your web browser to use I2P's HTTP proxy (see above) and browsing to the <code>.i2p</code> suffixed website (e.g. <a href=http://i2p-projekt.i2p/ target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p</a>). Also ensure your browser is configured to resolve DNS remotely when using the proxy to avoid DNS leaks.";
    t[725] = "Un eepsite \u00e8 un sito web ospitato in modo anonimo sulla rete I2P - puoi accedervi configurando il tuo browser web per utilizzare il proxy HTTP di I2P (vedi sopra) e visitando il sito web suffisso <code>.i2p</code> (ad es. <a href=http://i2p-projekt.i2p/ target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p</a>). Assicurati inoltre che il tuo browser sia configurato per risolvere i DNS in remoto quando utilizzi il proxy per evitare perdite di DNS.";
