    t[836] = "The first number is the number of peers your router has sent or received a message from in the last few minutes. This may range from 8-10 to several hundred, depending on your total bandwidth, shared bandwidth, and locally-generated traffic. The second number is the number of peers seen in the last hour or so. Do not be concerned if these numbers vary widely. <a href='/configstats#router.activePeers'>[Enable graphing]</a>.";
    t[837] = "Il primo numero \u00e8 il numero di peer dai quali il tuo router ha inviato o ricevuto un messaggio negli ultimi minuti. Questo pu\u00f2 variare da 8-10 a diverse centinaia, a seconda della tua larghezza di banda totale, della larghezza di banda condivisa e del traffico generato localmente. Il secondo numero \u00e8 il numero di peer visti nell'ultima ora circa. Non preoccuparti se questi numeri variano ampiamente. <a href='/configstats#router.activePeers'>[Abilita grafici]</a>.";
