    t[980] = "Your webserver is running by default at <a href=http://127.0.0.1:7658/>http://127.0.0.1:7658</a>, but is not accessible by others until you start the <i>I2P Webserver</i> tunnel. After starting the tunnel, your site will be difficult for other people to find. You could just tell people the destination or the Base32 address, but thankfully I2P has an address book to store domain names, and various services where you can <a href=/help/hostnameregistration>register a new .i2p domain</a> for free.";
    t[981] = "Il tuo server web \u00e8 in esecuzione per impostazione predefinita su <a href=http://127.0.0.1:7658/>http://127.0.0.1:7658</a>, ma non \u00e8 accessibile da altre persone fino a quando non avvii il tunnel <i>I2P Webserver</i>. Dopo aver avviato il tunnel, il tuo sito sar\u00e0 difficile da trovare per altre persone. Potresti semplicemente comunicare agli altri la destination o l'indirizzo Base32, ma fortunatamente I2P ha un registro degli indirizzi per memorizzare i nomi di dominio e vari servizi in cui puoi <a href=/help/hostnameregistration>registrare gratuitamente un nuovo dominio .i2p</a>.";
