    t[1174] = "Unless an outproxy has been set up for the service you want to connect to, this is not possible, with the exception of BitTorrent (see below). There are only three types of outproxies running right now: HTTP, HTTPS, and email. Note that there is currently no publicly listed SOCKS outproxy. If this type of service is required, try <a href=https://torproject.org/ target=_blank rel=noreferrer class='sitelink external'>Tor</a>.";
    t[1175] = "A meno che non sia stato configurato un outproxy per il servizio a cui si desidera connettersi, ci\u00f2 non \u00e8 possibile, ad eccezione di BitTorrent (vedi sotto). Al momento ci sono solo tre tipi di outproxy in esecuzione: HTTP, HTTPS e email. Si noti che attualmente non esiste un outproxy SOCKS pubblicamente elencato. Se \u00e8 necessario questo tipo di servizio, prova <a href=https://torproject.org/ target=_blank rel=noreferrer class='sitelink external'>Tor</a>.";
