    t[1209] = "Guardando la grande tecnologia...";
    t[1212] = "The skew (offset) of your computer's clock relative to the network-synced time (if known). I2P requires your computer's time be accurate. If the skew is more than a few seconds, please correct the problem by adjusting your computer's time. If I2P cannot connect to the internet, a reading of 0ms may be indicated. Note: This is only displayed in the <i>Router Information (advanced)</i> section. You may add this section to your Sidebar on the <a href='/configsidebar'>Sidebar Configuration page</a>.";
    t[1213] = "Lo spostamento (offset) dell'orologio del tuo computer rispetto all'ora sincronizzata della rete (se nota). I2P richiede che l'ora del tuo computer sia precisa. Se lo spostamento \u00e8 superiore a pochi secondi, correggi il problema regolando l'ora del tuo computer. Se I2P non pu\u00f2 connettersi a Internet, potrebbe essere indicata una lettura di 0ms. Nota: questo viene visualizzato solo nella sezione <i>Informazioni sul router (avanzato)</i>. Puoi aggiungere questa sezione alla barra laterale nella <a href='/configsidebar'>pagina di configurazione della barra laterale</a>.";
