    t[2210] = "I2P selects a random port between 9000 and 31000 to communicate with other routers when the program is run for the first time, or when your external IP address changes when running in <a href=/confignet#ipchange>Laptop Mode</a>. The <a href=/confignet#udpconfig>selected port</a> is shown on the <a href=/confignet>Network Configuration page</a>.";
    t[2211] = "I2P seleziona una porta casuale tra 9000 e 31000 per comunicare con altri router quando il programma viene eseguito per la prima volta, o quando il tuo indirizzo IP esterno cambia quando viene eseguito in <a href=/confignet#ipchange>Laptop Mode</a>. La <a href=/confignet#udpconfig>porta selezionata</a> \u00e8 mostrata sulla <a href=/confignet>pagina di configurazione di rete</a>.";
