    t[2232] = "It will take at least 10 minutes from your router starting for it to accept building participating tunnels in order to ensure your router is stable and successfully bootstrapped to the network.";
    t[2233] = "Ci vorranno almeno 10 minuti dall'avvio del router perch\u00e9 accetti la costruzione di tunnel partecipativi al fine di garantire che il tuo router sia stabile e avviato correttamente nella rete.";
