    t[2250] = "How long jobs are waiting before execution. The job queue is listed on the <a href='/jobs'>Jobs page</a>. Unfortunately, there are several other job queues in the router that may be congested, and their status is not available in the router console. The job lag should generally be zero. If it is consistently higher than 500ms, your computer is very slow, your network is experiencing connectivity issues, or the router has serious problems. <a href='/configstats#jobQueue.jobLag'>[Enable graphing]</a>.";
    t[2251] = "Quanto tempo i lavori stanno aspettando prima di essere eseguiti. La coda del lavoro \u00e8 elencata sulla <a href='/jobs'>pagina dei lavori</a>. Purtroppo, ci sono diverse altre code di lavoro nel router che possono essere congestionate, e il loro stato non \u00e8 disponibile nella console del router. Il ritardo del lavoro dovrebbe essere generalmente zero. Se \u00e8 costantemente superiore a 500 ms, il tuo computer \u00e8 molto lento, la tua rete sta riscontrando problemi di connettivit\u00e0 o il router ha seri problemi. <a href='/configstats#jobQueue.jobLag'>[Abilita il grafico]</a>.";
    t[2252] = "Configure I2P Updates";
    t[2253] = "Configura aggiornamenti I2P";
    t[2254] = "Before you tell the world about your new website, you should add some content. Go to the server's root directory <a href=#rootdir>listed above</a> and replace the <i>index.html</i> redirect page with your own content. If you need a template for a basic site, feel free to adapt <a href=http://127.0.0.1:7658/help/pagetemplate.html>this page</a>. If you're returned to this page after editing the content, try clearing your browser's web cache.";
    t[2255] = "Prima di comunicare al mondo il tuo nuovo sito web, dovresti aggiungere qualche contenuto. Vai alla directory radice del server <a href=#rootdir>riportata sopra</a> e sostituisci la pagina di reindirizzamento <i>index.html</i> con il tuo contenuto. Se hai bisogno di un modello per un sito di base, sentiti libero di adattare <a href=http://127.0.0.1:7658/help/pagetemplate.html>questa pagina</a>. Se sei tornato a questa pagina dopo aver modificato il contenuto, prova a cancellare la cache web del tuo browser.";
