    t[2376] = "To obtain your own hostname, I2P domain registrars such as <a href=http://stats.i2p/i2p/addkey.html target=_blank rel=noreferrer class=sitelink>stats.i2p</a> or <a href=http://reg.i2p/ target=_blank rel=noreferrer class=sitelink>reg.i2p</a> provide registration services that allow you to register and manage an .i2p hostname or sub-domain which will then be propagated across the network. Some registration sites will require the <i>B64 destination address</i> for the tunnel/service you wish to associate with a hostname, which you should copy from the <i>Local destination</i> section on the <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>.";
    t[2377] = "Per ottenere il proprio hostname, i registrar di domini I2P come <a href=http://stats.i2p/i2p/addkey.html target=_blank rel=noreferrer class=sitelink>stats.i2p</a> o <a href=http://reg.i2p/ target=_blank rel=noreferrer class=sitelink>reg.i2p</a> forniscono servizi di registrazione che ti permettono di registrare e gestire un hostname o sottodominio .i2p che poi sar\u00e0 propagato sulla rete. Alcuni siti di registrazione richiederanno l'<i>indirizzo di destinazione B64</i> del tunnel/servizio che desideri associare a un hostname, che dovrai copiare dalla sezione <i>Destination Locale</i> sulla <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Pagina di Configurazione del Gestore del Tunnel</a>.";
