    t[2482] = "This indicates the amount of RAM I2P is using, and the total amount available, allocated by Java. If the usage is consistently high relative to the available RAM, this may indicate that you need to increase the ram allocated to the JVM. You can allocate more RAM by editing your <code>wrapper.config</code> file which is normally located in the I2P application directory. You will need to edit the <code>wrapper.java.maxmemory</code> parameter, which by default is set to 256(MB) for I2P, or 384 for I2P+. Note: if the memory bar is enabled, the memory entry in the router info section will be suppressed.";
    t[2483] = "Questo indica la quantit\u00e0 di RAM utilizzata da I2P e la quantit\u00e0 totale disponibile, allocata da Java. Se l'utilizzo \u00e8 costantemente elevato rispetto alla RAM disponibile, potrebbe indicare che \u00e8 necessario aumentare la RAM allocata al JVM. \u00c8 possibile allocare pi\u00f9 RAM modificando il file <code>wrapper.config</code> che si trova di solito nella directory dell'applicazione I2P. Devi modificare il parametro <code>wrapper.java.maxmemory</code>, che di default \u00e8 impostato su 256 (MB) per I2P, o 384 per I2P+. Nota: se la barra di memoria \u00e8 abilitata, la voce di memoria nella sezione di informazioni del router verr\u00e0 soppressa.";
