    t[2536] = "Under <i>Configure Proxy Access to Internet</i> select the <i>Manual proxy configuration</i> option.";
    t[2537] = "Nella sezione <i>Configura accesso al proxy a Internet</i> seleziona l'opzione <i>Configurazione manuale del proxy</i>.";
    t[2538] = "To serve your own static content, you only need to edit or replace the files in the webserver's root directory, and the site will be available on the I2P network after you've followed the instructions below. Additionally, cgi and python scripts can be run from the <code>cgi-bin</code> directory immediately above <code>docroot</code> if you have <a href=https://www.perl.org/about.html target=_blank rel=noreferrer class='sitelink external'>perl</a> and <a href=https://www.python.org/ target=_blank rel=noreferrer class='sitelink external'>python</a> installed.";
    t[2539] = "Per servire il proprio contenuto statico, \u00e8 sufficiente modificare o sostituire i file nella directory radice del server web e il sito sar\u00e0 disponibile sulla rete I2P dopo aver seguito le istruzioni di seguito. Inoltre, gli script cgi e python possono essere eseguiti dalla directory <code>cgi-bin</code> immediatamente sopra <code>docroot</code> se hai installato <a href=https://www.perl.org/about.html target=_blank rel=noreferrer class='sitelink external'>perl</a> e <a href=https://www.python.org/ target=_blank rel=noreferrer class='sitelink external'>python</a>.";
