    t[2578] = "Many of the stats on the sidebar may be <a href='/configstats'>configured</a> to be <a href='/graphs'>graphed</a> for further analysis. You may also customize the sections that appear on the Sidebar and their positioning on the <a href='/configsidebar'>Sidebar Configuration page</a>.";
    t[2579] = "Molte delle statistiche sulla barra laterale possono essere <a href='/configstats'>configurate</a> per essere <a href='/graphs'>visualizzate come grafici</a> per ulteriori analisi. \u00c8 inoltre possibile personalizzare le sezioni che appaiono sulla barra laterale e la loro posizione nella <a href='/configsidebar'>pagina di configurazione della barra laterale</a>.";
    t[2582] = "This tunnel-specific setting allows you to enable or disable replies to pings sent to servers hosted by the router. To disable pings, you must add the line <code>i2p.streaming.answerPings=false</code> to the <i>Custom Options</i> section for the server's configuration in the Tunnel Manager.";
    t[2583] = "Questa impostazione specifica per il tunnel consente di abilitare o disabilitare le risposte ai ping inviati ai server ospitati dal router. Per disabilitare i ping, \u00e8 necessario aggiungere la riga <code>i2p.streaming.answerPings=false</code> alla sezione <i>Opzioni personalizzate</i> della configurazione del server nel Tunnel Manager.";
