    t[2598] = "If you wish to install unsigned (.zip) I2P updates, this should be added to your <code>router.config</code> file unless you have already configured <code>routerconsole.advanced=true</code>, in which case this option is already provisioned. Note: as of I2P+ 0.9.48+, installation of <a href=/configupdate#i2pupdates>unsigned updates</a> is enabled by default.";
    t[2599] = "Se desideri installare aggiornamenti I2P non firmati (.zip), ci\u00f2 deve essere aggiunto al tuo file <code>router.config</code> a meno che tu non abbia gi\u00e0 configurato <code>routerconsole.advanced=true</code>, nel qual caso questa opzione \u00e8 gi\u00e0 disponibile. Nota: a partire da I2P+ 0.9.48+, l'installazione di <a href=/configupdate#i2pupdates>aggiornamenti non firmati</a> \u00e8 abilitata per impostazione predefinita.";
