    t[2682] = "WAN Ethernet Link Configuration";
    t[2683] = "Configurazione Link WAN Ethernet";
    t[2696] = "This setting (in seconds) allows you to override the delay between runs of the Peer Exploration Job which attempts to locate new peers to add to the NetDb. The job will run every 80 seconds by default, or if the router is experiencing job or message lag, every 3 minutes. If the size of the NetDb reaches 4000 peers, the pause will increase to 15 minutes. You may wish to increase the delay if your NetDb is well-populated (over 2000 peers), or if you wish to reduce overall bandwidth usage. Note: For Floodfill routers, this job does not run.";
    t[2697] = "Questa impostazione (in secondi) ti consente di annullare il ritardo tra le esecuzioni del lavoro di esplorazione peer che tenta di individuare nuovi peer da aggiungere a NetDb. Di default, il lavoro viene eseguito ogni 80 secondi o, se il router sta riscontrando ritardi nei lavori o nei messaggi, ogni 3 minuti. Se la dimensione di NetDb raggiunge 4000 peer, la pausa aumenter\u00e0 a 15 minuti. Puoi aumentare il ritardo se il tuo NetDb \u00e8 ben popolato (oltre 2000 peer) o se desideri ridurre l'utilizzo complessivo della larghezza di banda. Nota: per i router Floodfill, questo lavoro non viene eseguito.";
    t[2698] = "Current";
    t[2699] = "Corrente";
    t[2720] = "A website hosted on the I2P network. By default, a <a href=https://www.eclipse.org/jetty/about.html class='sitelink external' target=_blank rel=noreferrer>Jetty webserver</a> is configured and running on <a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a>.";
    t[2721] = "Un sito web ospitato sulla rete I2P. Di default, un <a href=https://www.eclipse.org/jetty/about.html class='sitelink external' target=_blank rel=noreferrer>webserver Jetty</a> \u00e8 configurato ed in esecuzione su <a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a>.";
    t[2722] = "Can be disabled or changed in the <a href=/i2ptunnelmgr>Tunnel Manager</a>. Can also be configured to bind to a specific interface or all interfaces.";
    t[2723] = "Pu\u00f2 essere disabilitato o modificato nel <a href=/i2ptunnelmgr>Gestore del tunnel</a>. Pu\u00f2 anche essere configurato per collegarsi a un'interfaccia specifica o a tutte le interfacce.";
