    t[2754] = "You may create a new router family here. Once you have created the family, you may export the family key file and share with other routers in your nominated family.";
    t[2755] = "Puoi creare una nuova famiglia di router qui. Una volta creata la famiglia, puoi esportare il file chiave e condividerlo con altri router nella tua famiglia designata.";
