    t[2759] = "Ricerca avanzata";
    t[2766] = "In order to access websites hosted on I2P, and optionally use the default outproxy to connect to websites on clearnet, you will need to configure your browser to use the I2P HTTP proxy, by default running on <code>127.0.0.1 port 4444</code>. Most browsers offer an option to configure your proxy; in this mini-tutorial we'll focus on Firefox.";
    t[2767] = "Per accedere ai siti web ospitati su I2P e, opzionalmente, utilizzare l'outproxy predefinito per connettersi ai siti web su clearnet, \u00e8 necessario configurare il browser per utilizzare il proxy HTTP di I2P, che di default \u00e8 in esecuzione su <code>127.0.0.1 porta 4444</code>. La maggior parte dei browser offre un'opzione per configurare il proxy; in questa mini-guida ci concentreremo su Firefox.";
    t[2776] = "Close to us";
    t[2777] = "Vicino a noi";
    t[2790] = "I2P+ Router Sitemap";
    t[2791] = "Mappa del sito del router I2P";
    t[2794] = "Downloaded plugin version {0} is not newer than installed plugin";
    t[2795] = "La versione del plugin scaricato {0} \u00e8 meno recente di quella gi\u00e0 installata";
    t[2796] = "Streaming radio service";
    t[2797] = "Servizio di streaming radio";
    t[2798] = "I2P+ functions best when you can accurately reflect the speed of your network connection in the <a href=/config>bandwidth configuration section</a>. By default I2P+ is configured with some fairly conservative values that will not suit many use cases, so please take time to review these settings and correct where necessary. The more bandwidth you allocate, <i>specifically</i> upstream bandwidth, the more you will benefit from the network.";
    t[2799] = "I2P+ funziona al meglio quando puoi riflettere accuratamente la velocit\u00e0 della tua connessione di rete nella sezione di configurazione della larghezza di banda. Per impostazione predefinita, I2P+ \u00e8 configurato con alcuni valori piuttosto conservativi che non soddisfano molti casi d'uso, quindi prenditi il tempo per rivedere queste impostazioni e correggerle se necessario. Pi\u00f9 larghezza di banda allocerai, <i>specificamente</i> la larghezza di banda in upstream, pi\u00f9 beneficerai dalla rete.";
