    t[2882] = "The I2P Network Protocol (I2NP) manages the routing and mixing of messages between routers, in addition to the transport selection (where more than one is supported) when communicating with a peer. For more information, see the <a href=https://geti2p.net/en/docs/protocol/i2np class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[2883] = "Il protocollo di rete I2P (I2NP) gestisce la distribuzione e la miscelazione di messaggi tra i router, oltre alla selezione del trasporto (dove ne \u00e8 supportato pi\u00f9 di uno) durante la comunicazione con un peer. Per ulteriori informazioni, consultare <a href=https://geti2p.net/en/docs/protocol/i2np class='sitelink external' target=_blank rel=noreferrer>la documentazione online</a>.";
    t[2884] = "Expired {0} ago";
    t[2885] = "Scaduto {0} fa";
    t[2892] = "Your router's status on accepting or rejecting requests from other routers to build a participating tunnel through your router. Your router may accept all requests, accept or reject a percentage of requests, or reject all requests for a number of reasons, to control the bandwidth and CPU demands and maintain capacity for local clients. <b>Note";
    t[2893] = "Lo stato del tuo router nell'accettare o rifiutare le richieste di altri router per costruire un tunnel partecipativo attraverso il tuo router. Il tuo router potrebbe accettare tutte le richieste, accettare o rifiutare una percentuale di richieste o rifiutare tutte le richieste per vari motivi, per controllare le esigenze di larghezza di banda e CPU e mantenere la capacit\u00e0 per i clienti locali. <b>Nota</b>";
    t[2902] = "Please contact a known trustworthy friend who has a running I2P router, and ask them for help with reseeding your I2P router. Request that they send you a reseed file exported from their running I2P router. It is vital that the file is exchanged over a secure channel, e.g. encrypted to avoid external tampering (PGP Sign, Encrypt and Verified with a trusted public key). The file itself is unsigned, so please accept files only from known trusted friends. Never import a reseed file if you cannot verify its source.";
    t[2903] = "Perfavore contatta un amico affidabile che ha un router I2P attivo, e chiedi aiuto con il reseeding del tuo router I2P. Richiedi un file di reseed esportato dal loro router I2P attivo. E' vitale che questo file sia condiviso attraverso un canale sicuro, es. criptato per evitare manipolazioni esterne (Firma PGP, Codificata e verificata con una chiave pubblica fidata). Il file stesso non \u00e8 firmato, quindi perfavore accetta file solo da amici fidati. Non importare mai un file di reseed di cui non puoi verificare la fonte.";
    t[2916] = "Last Good Send";
