    t[2921] = "\u00c8 possibile utilizzare un registratore in un tunnel che scrive su un file che un altro tunnel, o pi\u00f9 tunnel, possono utilizzare per limitare la velocit\u00e0. Questi file possono anche essere modificati manualmente.";
