    t[2956] = "The Java web applications listed below are started by the webConsole client and run in the same JVM as the router. They are usually web applications accessible through the router console. They may be complete applications (e.g. i2psnark), front-ends to another client or application which must be separately enabled (e.g. susidns, i2ptunnel), or have no web interface at all (e.g. addressbook).";
    t[2957] = "Le applicazioni java elencate sotto sono avviate dal client webConsole e girano nella stessa JVM come il router. Sono spesso delle applicazioni web accessibili dalla console del router. Possono essere applicazioni complete (es. i2psnark), front-ends per altri client o applicazioni che devono essere abilitate separatamente (es. susidns, i2ptunnel), o avere persino nessuna interfaccia web (es. rubrica).";
