    t[2978] = "This is the total number of peers that are known by your router. They are listed on the <a href='/netdb'>Network Database page</a>. This may range from under 100 to 1000 or more. This number is not the total size of the network; it may vary widely depending on your total bandwidth, shared bandwidth, and locally-generated traffic. I2P does not require a router to know every other router in the network.";
    t[2979] = "Questo \u00e8 il numero totale di peer conosciuti dal tuo router. Sono elencati sulla <a href='/netdb'>pagina del Database di Rete</a>. Questo numero pu\u00f2 variare da meno di 100 a 1000 o pi\u00f9. Questo numero non rappresenta la dimensione totale della rete; pu\u00f2 variare ampiamente a seconda della tua larghezza di banda totale, della larghezza di banda condivisa e del traffico generato localmente. I2P non richiede che un router conosca ogni altro router nella rete.";
