    t[3062] = "You can override the <a href=http://127.0.0.1:7658/help/images/>default appearance</a> of the directory listing by supplying an edited <a href=http://127.0.0.1:7658/.resources/jetty-dir.css>jetty-dir.css</a> file to set a global appearance. Note that this file will not be displayed in the webserver's directory listing. Files and directories prefixed with . and files named favicon.ico or files ending with ~ or .bak or .old will also be hidden from view (though still accessible). Note: To create hidden files with a . prefix on Windows, add a trailing . to the file or directory e.g. <code>.hidden.</code>; Windows explorer will then save the file with the correct name, removing the trailing dot in the process.";
    t[3063] = "Puoi sovrascrivere l'<a href=http://127.0.0.1:7658/help/images/>aspetto predefinito</a> della lista delle directory fornendo un file <a href=http://127.0.0.1:7658/.resources/jetty-dir.css>jetty-dir.css</a> modificato per impostare un aspetto globale. Nota che questo file non sar\u00e0 visualizzato nell'elenco delle directory del server web. I file e le directory con prefisso . e i file di nome favicon.ico o i file con estensione ~ o .bak o .old saranno anche nascosti dalla vista (anche se ancora accessibili). Nota: per creare file nascosti con un prefisso . su Windows, aggiungi un punto finale al file o alla directory ad esempio <code>.hidden.</code>; l'esplora risorse Windows salver\u00e0 quindi il file con il nome corretto, rimuovendo il punto finale durante il processo.";
