    t[3188] = "When set to true, additional functionality will be enabled in the console and the user will be able to edit settings directly on the <a href=/configadvanced>Advanced Configuration page</a>. Extra display options are provided in the <a href=/netdb>Network Database section</a>, including the <a href='/netdb?f=3'>Sybil Analysis tool</a>, and there are additional configuration options on the <a href=/configclients>Clients Configuration page</a>. This will also enable the installation of unsigned updates, manual configuration of the news URL, and additional sections on the sidebar.";
    t[3189] = "Quando impostato su true, funzionalit\u00e0 aggiuntive saranno abilitate nella console e l'utente sar\u00e0 in grado di modificare le impostazioni direttamente nella <a href=/configadvanced>pagina di configurazione avanzata</a>. Opzioni di visualizzazione extra sono fornite nella <a href=/netdb>sezione del Database di rete</a>, compreso lo strumento di <a href='/netdb?f=3'>analisi Sybil</a>, e ci sono ulteriori opzioni di configurazione nella <a href=/configclients>pagina di configurazione dei client</a>. Ci\u00f2 permetter\u00e0 anche l'installazione di aggiornamenti non firmati, la configurazione manuale dell'URL delle notizie e sezioni aggiuntive nella barra laterale.";
