    t[3483] = "Questa impostazione determina se le statistiche sul nostro router vengono pubblicate sporadicamente su NetDb. [Il valore predefinito \u00e8 falso]";
    t[3486] = "This is the number of peers your router has available for building client tunnels. It is generally in the range 8-30. Your fast peers are shown on the <a href='/profiles'>Profiles page</a>. <a href='/configstats#router.fastPeers'>[Enable graphing]</a>";
    t[3487] = "Questo \u00e8 il numero di peer disponibili per il tuo router per costruire tunnel client. Di solito \u00e8 compreso tra 8 e 30. I tuoi peer veloci sono visualizzati sulla <a href='/profiles'>pagina dei profili</a>. <a href='/configstats#router.fastPeers'>[Abilita grafici]</a>";
    t[3488] = "Click the <i>Reseed from File</i> button";
    t[3489] = "Clicca il pulsante <i>Reseed from File</i>";
    t[3490] = "A variant of onion routing that encrypts multiple messages together to make it more difficult for attackers to perform traffic analysis and to increase the speed of data transfer. For more information, see the <a href=https://geti2p.net/en/docs/how/garlic-routing class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[3491] = "Una variante di onion routing che cripta pi\u00f9 messaggi insieme per rendere pi\u00f9 difficile agli attaccanti l'analisi del traffico e aumentare la velocit\u00e0 di trasferimento dei dati. Per ulteriori informazioni, consultare la <a href=https://geti2p.net/en/docs/how/garlic-routing class='sitelink external' target=_blank rel=noreferrer>documentazione online</a>.";
    t[3494] = "How to Harden Your WordPress Site";
    t[3495] = "Come rafforzare il tuo sito WordPress";
    t[3496] = "I2P Internals";
    t[3497] = "Interni I2P";
    t[3500] = "By default, I2P is supplied with a webserver to host your own anonymized website (traditionally referred to as an <i>eepsite</i>). Both the site and the I2P Router Console are running on a streamlined version of <a href='https://en.wikipedia.org/wiki/Jetty_(web_server)' target=_blank rel=noreferrer class='sitelink external'>Jetty</a>, customized for I2P.";
    t[3501] = "Per impostazione predefinita, I2P \u00e8 fornito con un server web per ospitare il proprio sito web anonimizzato (tradizionalmente definito come <i>eepsite</i>). Sia il sito che la console del router I2P sono in esecuzione su una versione semplificata di <a href='https://en.wikipedia.org/wiki/Jetty_(web_server)' target=_blank rel=noreferrer class='sitelink external'>Jetty</a> personalizzato per I2P.";
    t[3504] = "This setting allows you to exclude older routers from your NetDb. Routers older than the default or the value you set will be deleted from the NetDb and banned for the duration of the router session. By default, routers older than 0.9.20 are excluded. Note: starting with I2P+ version 0.9.46+, only routers running very recent versions are used for building local tunnels. [Restart required]";
    t[3505] = "Questa impostazione consente di escludere router pi\u00f9 vecchi dal tuo NetDb. I router pi\u00f9 vecchi del valore predefinito o del valore che hai impostato verranno eliminati da NetDb e banditi per la durata della sessione del router. Di default, i router pi\u00f9 vecchi di 0.9.20 sono esclusi. Nota: a partire dalla versione 0.9.46+ di I2P+, vengono utilizzate solo versioni molto recenti dei router per la creazione di tunnel locali. [Necessita riavvio]";
