    t[3546] = "This setting, in milliseconds, overrides the default message processing time limit (indicated as <i>Message Delay</i> in the Congestion sidebar section) before the router is determined to be congested and transit tunnel requests are rejected. [Default is 750ms or 1500ms if the router is flagged as slow]";
    t[3547] = "Questa impostazione, in millisecondi, ridefinisce il limite di tempo di elaborazione dei messaggi predefinito (indicato come <i>Message Delay</i> nella sezione barra laterale Congestion) prima che il router sia determinato come congestionato e le richieste di tunnel di transito vengano respinte. [Default is 750ms or 1500ms if the router is flagged as slow]";
