    t[3639] = "UDP in uscita sulla porta 123, consentendo le risposte: ci\u00f2 \u00e8 necessario per la sincronizzazione interna del tempo di I2P (tramite SNTP - interrogando un host SNTP casuale in <code>pool.ntp.org</code> o <a href=/help/advancedsettings#ntpserverconfig>un altro server specificato</a>).";
