    t[3654] = "XChat-like client users can create a new network with the server <code>127.0.0.1/6668</code> (remember to tick <i>Bypass proxy server</i> if you have a proxy server configured), or you can connect with the command <code>/server 127.0.0.1 6668</code>. Different IRC clients may vary the syntax.";
    t[3655] = "Gli utenti del client simili a XChat possono creare una nuova rete con il server <code>127.0.0.1/6668</code> (ricordati di spuntare <i>Bypassa server proxy</i> se hai configurato un server proxy), oppure puoi collegarti con il comando <code>/server 127.0.0.1 6668</code>. Diversi client IRC possono variare la sintassi.";
