    t[3704] = "The router configuration options listed below are not available in the user interface, usually because they are rarely used or provide access to advanced settings that most users will not need. This is not a comprehensive list. Some settings will require a restart of the router to take effect. Note that all settings are case sensitive. You will need to edit your <code>router.config</code> file to add options, or, once you have added <code>routerconsole.advanced=true</code> to the router.config file, you may edit settings within the console on the <a href=/configadvanced>Advanced Configuration page</a>.";
    t[3705] = "Le opzioni di configurazione del router elencate di seguito non sono disponibili nell'interfaccia utente, di solito perch\u00e9 vengono utilizzate raramente o forniscono accesso a impostazioni avanzate di cui la maggior parte degli utenti non avr\u00e0 bisogno. Questa non \u00e8 una lista esauriente. Alcune impostazioni richiederanno un riavvio del router per avere effetto. Si noti che tutte le impostazioni sono sensibili al caso. Dovrai modificare il tuo file <code>router.config</code> per aggiungere opzioni o, una volta aggiunto <code>routerconsole.advanced=true</code> al file router.config, \u00e8 possibile modificare le impostazioni All'interno della console sulla pagina di configurazione avanzata di <a href=/configadvanced>pagina di configurazione avanzata</a>.";
