    t[4332] = "Note: The order of the declarations matters. The first threshold declaration for a given destination (whether explicit or listed in a referenced file) overrides any future thresholds for the same destination, whether explicit or listed in a file. Note: to apply a new filter file, the tunnel must be restarted after the location has been specified in the tunnel manager. Once configured, a definition file can be updated without requiring a restart of the target tunnel, although destinations that are blocked will persist until the tunnel is restarted.";
    t[4333] = "Nota: L'ordine delle dichiarazioni \u00e8 importante. La prima dichiarazione di soglia per una certa destinazione (sia esplicita che elencata in un file di riferimento) sostituisce tutte le future soglie per la stessa destinazione, sia esplicite che elencate in un file. Nota: per applicare un nuovo file di filtro, il tunnel deve essere riavviato dopo che la posizione \u00e8 stata specificata nel gestore del tunnel. Una volta configurato, un file di definizione pu\u00f2 essere aggiornato senza richiedere il riavvio del tunnel di destinazione, anche se le destinazioni bloccate persistono fino al riavvio del tunnel.";
