    t[4671] = "La versione del software I2P che stai utilizzando. Se \u00e8 disponibile una nuova versione, verrai avvisato nella barra laterale. \u00c8 consigliato mantenere il tuo router aggiornato per garantire prestazioni e sicurezza ottimali. Di solito vengono rilasciati aggiornamenti del router mediamente ogni 2-3 mesi.";
