    t[4702] = "NTCP (NIO-based TCP) and NTCP2 are TCP-based network transports which use Java's NIO (New I/O) TCP implementation to deliver I2NP messages between routers on the network. NTCP2 improves the resistance of NTCP to various attacks and automated traffic identification methods. For more information, see the <a href=https://geti2p.net/en/docs/transport/ntcp class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[4703] = "NTCP (NIO-based TCP) e NTCP2 sono trasporti di rete basati su TCP che utilizzano l'implementazione TCP di Java's NIO (New I/O) per consegnare messaggi I2NP tra router sulla rete. NTCP2 migliora la resistenza di NTCP a vari attacchi e metodi di identificazione automatica del traffico. Per ulteriori informazioni, vedere la <a href=https://geti2p.net/en/docs/transport/ntcp class='sitelink external' target=_blank rel=noreferrer>documentazione online</a>.";
    t[4708] = "You can use a recorder to log the destinations of aggressive clients to a specified file, and then use that same file to throttle them. The following snippet defines a filter that initially allows all connection requests, but if any single destination exceeds 180 requests in 60 seconds, it gets throttled down to 30 requests every 60 seconds:";
    t[4709] = "\u00c8 possibile utilizzare un registratore per registrare le destinazioni dei client aggressivi su un file specificato e quindi utilizzare lo stesso file per limitarne la velocit\u00e0. Lo snippet seguente definisce un filtro che inizialmente consente tutte le richieste di connessione, ma se una singola destinazione supera le 180 richieste in 60 secondi, verr\u00e0 limitata a 30 richieste ogni 60 secondi:";
