    t[4930] = "This setting, when configured with a path pointing at a valid blocklist file, enables an additional, user-configured blocklist to be loaded at router startup. [Disabled by default, restart required]";
    t[4931] = "Questa impostazione, quando configurata con un percorso che punta a un file blocklist valido, consente di caricare una blocklist aggiuntiva configurata dall'utente all'avvio del router. [Disabilitato per impostazione predefinita, riavvio richiesto]";
    t[4932] = "I2P+ supports custom theme overrides for the console, the tunnel manager, I2PSnark, SusiDNS and Susimail, permitting changes to the themes which are persistent after upgrades. In order to activate an override, create a css file named <code>override.css</code> with your theme modifications and place it in the relevant theme directory of the theme you wish to change, or rename one of the example files, and then hard refresh the browser. Note that the tunnel manager and the console share the same override.css. To deactivate an override, delete or rename the <code>override.css</code> file and then hard refresh the browser (usually Control + Shift + R).";
    t[4933] = "I2P+ supporta sostituzioni personalizzate dei temi per la console, il tunnel manager, I2PSnark, SusiDNS e Susimail, consentendo modifiche ai temi che sono persistenti dopo gli aggiornamenti. Per attivare una sostituzione, crea un file css chiamato <code>override.css</code> con le tue modifiche del tema e posizionalo nella directory del tema rilevante che desideri cambiare, o rinomina uno dei file di esempio, quindi aggiorna il browser completamente. Nota che il tunnel manager e la console condividono lo stesso override.css. Per disattivare una sostituzione, elimina o rinomina il file <code>override.css</code> e quindi aggiorna completamente il browser (di solito Control + Shift + R).";
