    t[5042] = "When set to true, this setting enables reverse DNS lookups for peers, triggered when displaying the country flag of a peer or when the hostname or domain is explicitly displayed in the console, or when the peer's RouterInfo is written to disk. In order to avoid repeat lookups, it's recommended to configure a generous caching policy for DNS lookups of 10 minutes or more, and to configure a privacy respecting DNS server in your operating system. [Disabled by default, restart required]";
    t[5043] = "Quando impostato su vero, questa impostazione abilita ricerche DNS inverse per i peer, innescate quando viene visualizzata la bandiera del paese di un peer o quando l'hostname o dominio viene esplicitamente visualizzato nella console, o quando le informazioni del router del peer vengono scritte su disco. Per evitare ricerche ripetute, si consiglia di configurare una politica di cache generosa per le ricerche DNS di 10 minuti o pi\u00f9 e di configurare un server DNS che rispetti la privacy nel proprio sistema operativo. [Disabilitato per impostazione predefinita, riavvio richiesto]";
