    t[5084] = "If you're running a dynamic site handling a large number of concurrent users, content caching can often improve the time taken to deliver pages. For content that rapidly changes, a <a href=https://blog.stackpath.com/glossary-micro-caching/ target=_blank class='sitelink external'>micro-caching strategy</a> may still yield some benefits. The <a href=https://www.nginx.com/ target=_blank class='sitelink external'>Nginx webserver</a> provides a competent caching sub-system, or for a more heavy-weight solution, have a look at <a href=https://varnish-cache.org/ target=_blank class='sitelink external'>Varnish</a>.";
    t[5085] = "Se stai gestendo un sito dinamico che elabora un gran numero di utenti contemporanei, la memorizzazione nella cache del contenuto pu\u00f2 spesso migliorare il tempo necessario per fornire le pagine. Per i contenuti che cambiano rapidamente, una <a href=https://blog.stackpath.com/glossary-micro-caching/ target=_blank class='sitelink external'>strategia di micro-caching</a> pu\u00f2 ancora fornire alcuni vantaggi. Il server web <a href=https://www.nginx.com/ target=_blank class='sitelink external'>Nginx</a> fornisce un sottosistema di memorizzazione nella cache competente o, per una soluzione pi\u00f9 pesante, prova <a href=https://varnish-cache.org/ target=_blank class='sitelink external'>Varnish</a>.";
