    t[5514] = "If after a few minutes of uptime your router is indicating 0 Active Peers and 0 Known Peers, with a notification in the sidebar that you need to check your network connection, verify that you can access the internet. If your internet connection is functional, you may need to unblock Java in your firewall. Otherwise, you may need to reseed your I2P router. Visit the <a href=/configreseed#reseedconfig>Reseed Configuration page</a> and click the <i>Save Changes and Reseed Now</i> button. For more information, see the <a href=#reseedhelp>Reseed help section</a> above.";
    t[5515] = "Se dopo alcuni minuti di uptime il tuo router indica 0 Peer attivi e 0 Peer conosciuti, con una notifica nella barra laterale che ti richiede di controllare la connessione di rete, verifica se riesci ad accedere a internet. Se la tua connessione internet funziona correttamente, potresti dover sbloccare Java nel tuo firewall. Altrimenti, potresti dover rialimentare il tuo router I2P. Visita la pagina <a href=/configreseed#reseedconfig>Configurazione Rialimentazione</a> e clicca il pulsante <i>Salva Modifiche e Rialimenta Ora</i>. Per ulteriori informazioni, consulta la sezione di assistenza sulla rialimentazione cliccando <a href=#reseedhelp>qui</a>.";
    t[5518] = "A higher level socket API for clients. Only opened when a SAM V3 client requests a UDP session. Can be enabled/disabled on the <a href=/configclients> Client Configuration page</a>. Can be changed in the <code>clients.config</code> file with the SAM command line option <code>sam.udp.port=nnnn</code>.";
    t[5519] = "Una API socket di livello superiore per i client. Viene aperto solo quando un client SAM V3 richiede una sessione UDP. Pu\u00f2 essere abilitato/disabilitato nella <a href=/configclients>pagina di configurazione del client</a>. Pu\u00f2 essere modificato nel file <code>clients.config</code> con l'opzione della linea di comando SAM <code>sam.udp.port=nnnn</code>.";
    t[5526] = "If you want your site to feel responsive, image compression is essential when hosting large images. Using a service like <a href=https://tinypng.com/ target=_blank class='sitelink external'>tinypng.com</a> to compress your png and jpeg images will often result in much smaller files with minimal loss of quality. In some situations the webp format can best jpegs, generating smaller files with approximately the same or better visual fidelity, and has wide browser support. Also consider using svgs instead of bitmaps for icons and illustrations - they're often smaller than the equivalent bitmap file (run them through a service like <a href=https://vecta.io/nano target=_blank class='sitelink external'>Nano SVG Optimizer</a> to remove unneeded cruft), scale without loss of quality, and can be gzipped by your webserver.";
    t[5527] = "Se vuoi che il tuo sito abbia una risposta rapida, \u00e8 essenziale comprimere le immagini quando ospiti immagini di grandi dimensioni. Utilizzare un servizio come <a href=https://tinypng.com/ target=_blank class='sitelink external'>tinypng.com</a> per comprimere le immagini png e jpeg spesso comporta file molto pi\u00f9 piccoli con una perdita minima di qualit\u00e0. In alcune situazioni, il formato webp pu\u00f2 essere migliore dei jpeg, generando file pi\u00f9 piccoli con approssimativamente la stessa o migliore fedelt\u00e0 visiva ed ha un ampio supporto di browser. Considera anche l'utilizzo di svgs al posto di immagini bitmap per icone e illustrazioni: spesso sono pi\u00f9 piccole rispetto al file bitmap equivalente (eseguile attraverso un servizio come <a href=https://vecta.io/nano target=_blank class='sitelink external'>Nano SVG Optimizer</a> per rimuovere ci\u00f2 che non \u00e8 necessario), scalano senza perdita di qualit\u00e0 e possono essere compresse dal tuo web server utilizzando gzip.";
    t[5528] = "UPnP disabled on the device";
    t[5529] = "UPnP disabilitato sul dispositivo";
    t[5536] = "By default, most of your client services (mail, http proxy, IRC) will share the same set of tunnels (for performance reasons) and be listed as <i>Shared Clients</i> and <i>Shared Clients(DSA)</i> in the sidebar under Service Tunnels and on the <a href=/tunnels>Tunnels page</a>.";
    t[5537] = "Di default, la maggior parte dei tuoi servizi client (posta, proxy http, IRC) condivideranno lo stesso insieme di tunnel (per motivi di prestazioni) e saranno elencati come <i>Client Condivisi</i> e <i>Client Condivisi(DSA)</i> nella barra laterale sotto Tunnel di servizio e nella pagina <a href=/tunnels>Pagina dei tunnel</a>.";
