    t[5545] = "Questa sezione non \u00e8 abilitata di default a meno che la modalit\u00e0 <a href='/help/configuration#advancedconsole'>Console Avanzata</a> non sia abilitata. Puoi abilitarla nella <a href='/configsidebar'>pagina di configurazione della barra laterale</a>.";
