    t[5712] = "Firewalled with Inbound TCP Enabled";
    t[5713] = "Firewall con TCP in entrata abilitato";
    t[5716] = "Open <a href=/confignet#udpconfig>I2P+'s port</a> on your modem, router and/or firewall(s) for better connectivity (ideally both UDP and TCP). More information on how to go about port forwarding can be found at <a href=http://portforward.com/ target=_blank rel=noreferrer class='sitelink external'>portforward.com</a>, in addition to our forums and IRC channels listed below. Note that I2P does not support connecting to the internet via an http or socks proxy [patches welcome!], though you can connect to proxies via I2P itself once connected to the network.";
    t[5717] = "Apri <a href=/confignet#udpconfig>la porta di I2P+</a> sul tuo modem, sul router e/o sui firewall per una migliore connettivit\u00e0 (ideale sia UDP che TCP). Ulteriori informazioni su come procedere con il port forwarding possono essere trovate su <a href=http://portforward.com/ target=_blank rel=noreferrer class='sitelink external'>portforward.com</a>, oltre ai nostri forum e canali IRC elencati di seguito. Nota che I2P non supporta la connessione a Internet tramite un proxy http o socks [patches benvenuti!], anche se \u00e8 possibile connettersi a proxy tramite I2P stesso una volta connesso alla rete.";
    t[5730] = "A tunnel filter can provide protection against denial of service attacks, without otherwise interrupting the service for genuine users, either in conjunction with the tunnel throttler or as an alternative strategy. It can also be used to log access to a hosted service to determine if the server is under attack, or simply to log all visitors by I2P destination. Additionally, a filter can function simultaneously as a whitelist and blacklist making it more flexible than the Tunnel Manager's access list controls. Note that multiple server tunnels can share a single filter file if you wish to implement a global filter.";
    t[5731] = "Un filtro del tunnel pu\u00f2 offrire protezione dagli attacchi di denial of service senza interrompere altrimenti il servizio per gli utenti legittimi, sia in combinazione con il throttler del tunnel o come strategia alternativa. Pu\u00f2 anche essere utilizzato per registrare l'accesso a un servizio ospitato  per determinare se il server \u00e8 sotto attacco, o semplicemente per registrare tutti i visitatori per destinazione I2P. Inoltre, un filtro pu\u00f2 funzionare contemporaneamente come lista bianca e lista nera, rendendolo pi\u00f9 flessibile rispetto ai controlli della lista di accesso del Gestore del tunnel. Nota che pi\u00f9 tunnel del server possono condividere un singolo file di filtro se si desidera implementare un filtro globale.";
