    t[6026] = "This setting (in milliseconds) allows you to manually configure the delay between router refresh updates run by the Refresh Routers Job. By default the pause between refreshes is determined by the size of the NetDb, and introduces some randomness in the timing to mitigate traffic analysis. For values lower than 2000 milliseconds, increasing the value of <code>router.refreshTimeout</code> is recommended. Note that setting this value below 2000 milliseconds will increase your network traffic and may introduce job lag, and is not recommended for sustained use.";
    t[6027] = "Questa impostazione (in millisecondi) consente di configurare manualmente il ritardo tra gli aggiornamenti del router eseguiti dal job Refresh Routers. Per impostazione predefinita, la pausa tra gli aggiornamenti dipende dalla dimensione di NetDb e introduce una certa casualit\u00e0 nel timing per mitigare l'analisi del traffico. Per valori inferiori a 2000 millisecondi, si consiglia di aumentare il valore di <code>router.refreshTimeout</code>. Notare che impostare questo valore al di sotto di 2000 millisecondi aumenter\u00e0 il traffico di rete e potrebbe causare ritardi nel job, pertanto non \u00e8 consigliato per un utilizzo prolungato.";
    t[6030] = "Server tunnels, configurable in the <a href=/i2ptunnelmgr>Tunnel Manager</a>, provide a number of ways to limit access to the hosted service. Destination whitelisting, blacklisting, connection throttling, and tunnel filtering are methods provisioned to mitigate denial of service attacks, grant exclusive access to known I2P destinations, and manage traffic to the server.";
    t[6031] = "I tunnel del server, configurabili nel <a href=/i2ptunnelmgr>Gestore dei tunnel</a>, forniscono diverse modalit\u00e0 per limitare l'accesso al servizio ospitato. La lista bianca delle destinazioni, la lista nera, il controllo della connessione e il filtraggio del tunnel sono metodi predisposti per mitigare gli attacchi di denial of service, concedere accesso esclusivo alle destiazioni I2P conosciute e gestire il traffico verso il server.";
