    t[6382] = "Note: To enhance your security when browsing .i2p sites, you may wish to consider installing an addon to prevent Javascript from running in the browser such as <a href=https://addons.mozilla.org/en-US/firefox/addon/noscript/ target=_blank rel=noreferrer class='sitelink external'>NoScript</a>, though it's recommended to whitelist the address I2P+ is running on to enable various router console enhancements. In addition, an addon that prevents requests to offsite resources is also recommended, for example <a href=https://addons.mozilla.org/en-US/firefox/addon/umatrix/ target=_blank rel=noreferrer class='sitelink external'>uMatrix</a>.";
    t[6383] = "Nota: Per aumentare la sicurezza durante la navigazione di siti .i2p, potresti considerare l'installazione di un componente aggiuntivo per impedire l'esecuzione di Javascript nel browser, come <a href=https://addons.mozilla.org/en-US/firefox/addon/noscript/ target=_blank rel=noreferrer class='sitelink external'>NoScript</a>, sebbene sia consigliabile inserire l'indirizzo su cui \u00e8 in esecuzione I2P+ nella whitelist per abilitare vari miglioramenti della console del router. Inoltre, \u00e8 consigliabile anche un componente aggiuntivo che impedisce richieste a risorse esterne, ad esempio <a href=https://addons.mozilla.org/en-US/firefox/addon/umatrix/ target=_blank rel=noreferrer class='sitelink external'>uMatrix</a>.";
