    t[6945] = "Un'implementazione Java di un client Tor, disponibile come plugin I2P. Pu\u00f2 essere utilizzato come <i>outproxy</i> predefinito se configurato nel tunnel del client SOCKS o HTTP rilevante nel <i>Gestore tunnel</i>. Disponibile su <a href=http://stats.i2p/i2p/plugins class=sitelink>http://stats.i2p/i2p/plugins</a>. Il codice sorgente \u00e8 disponibile su <a href=https://github.com/i2p/i2p.plugins.orchid class='sitelink external' target=_blank rel=noreferrer>github</a>.";
    t[6952] = "IPv4 Addresses";
    t[6953] = "Indirizzi IPv4";
    t[6956] = "This section indicates your average bandwidth speeds and total usage for the session. All values are in bytes per second. You may change your bandwidth limits on the <a href='/config'>Bandwidth Configuration page</a>. The more bandwidth you make available, the more you help the network and improve your own anonymity, so please take the time to review the settings. If you are unsure of your network's speed, using a service such as <a href='http://speedtest.net/'>SpeedTest</a> or similar will give you a good indication of your bandwidth capability. Your upstream share amount (KBps Out) will determine your overall contribution to the network. Bandwidth is <a href='/graphs'>graphed</a> by default.";
    t[6957] = "Questa sezione indica le velocit\u00e0 medie di larghezza di banda e l'utilizzo totale per la sessione. Tutti i valori sono in byte al secondo. Puoi modificare i limiti di larghezza di banda sulla <a href='/config'>pagina di configurazione della larghezza di banda</a>. Pi\u00f9 larghezza di banda metti a disposizione, pi\u00f9 aiuti la rete e migliori la tua anonimato, quindi prenditi il tempo di rivedere le impostazioni. Se non sei sicuro della velocit\u00e0 della tua rete, utilizzare un servizio come <a href='http://speedtest.net/'>SpeedTest</a> o simili ti dar\u00e0 un'indicazione precisa delle tue capacit\u00e0 di larghezza di banda. La quantit\u00e0 di larghezza di banda condivisa in upload (KBps Out) determiner\u00e0 il tuo contributo complessivo alla rete. La larghezza di banda viene <a href='/graphs'>rappresentata graficamente</a> di default.";
