    t[7004] = "This setting allows you to configure the minimum number of hosted participating tunnels before the router starts to reject tunnel requests based on anticipated bandwidth requirements. [Default is 100 if system is running Android, 800 if system is running on ARM and less than 4 cores available, 1200 if system is running on ARM and 4 or more cores available, otherwise 2500]";
    t[7005] = "Questa impostazione consente di configurare il numero minimo di tunnel partecipanti ospitati prima che il router inizi a respingere le richieste di tunnel in base ai requisiti di larghezza di banda previsti. [Il valore predefinito \u00e8 100 se il sistema \u00e8 Android, 800 se il sistema \u00e8 ARM e ha meno di 4 core disponibili, 1200 se il sistema \u00e8 ARM e ha 4 o pi\u00f9 core disponibili, altrimenti 2500]";
