    t[7022] = "This setting (in milliseconds) allows you to manually configure the queue delay target value for the CoDel queue management system. Default is 50ms. [Restart required]";
    t[7023] = "Questa impostazione (in millisecondi) consente di configurare manualmente il valore obiettivo del ritardo della coda per il sistema di gestione delle code CoDel. Il valore predefinito \u00e8 50ms. [Richiesta la riavvio]";
    t[7030] = "In order to maintain anonymity, it is recommended to update using the I2P http proxy. If the news or I2P update is hosted on I2P, using the proxy will be necessary.";
    t[7031] = "In modo da mantenere anonimit\u00e0, \u00e8 raccomandato di aggiornare usando il proxy http di I2P. Se le notizie o l'aggiornamento di I2P sono ospitati su I2P, sar\u00e0 necessario usare il proxy.";
