    t[7166] = "The I2P Client Protocol (I2CP) enables external applications (clients) to communicate with I2P over single TCP socket, by default using port 7654. For more information, see the <a href=https://geti2p.net/en/docs/protocol/i2cp class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7167] = "Il Protocollo Client I2P (I2CP) consente alle applicazioni esterne (client) di comunicare con I2P tramite una singola presa TCP, di default utilizzando la porta 7654. Per ulteriori informazioni, consultare la <a href=https://geti2p.net/en/docs/protocol/i2cp class='sitelink external' target=_blank rel=noreferrer>documentazione online</a>.";
    t[7168] = "Queue Totals";
    t[7169] = "In coda totali";
    t[7170] = "This setting determines which transport takes priority when communicating with peers. By default, NTCP is favored over UDP (SSU). By setting the value to true, UDP will be favored unless a pre-existing NTCP connection exists; when set to always, UDP will always be used regardless of any pre-existing NTCP connection. [Default is false]";
    t[7171] = "Questa impostazione determina quale trasporto ha la priorit\u00e0 durante la comunicazione con gli altri utenti. Per impostazione predefinita, NTCP prevale su UDP (SSU). Impostando il valore su true, UDP avr\u00e0 la priorit\u00e0 a meno che non esista una connessione NTCP preesistente; quando impostato su always, UDP verr\u00e0 sempre utilizzato indipendentemente da eventuali connessioni NTCP preesistenti. [Il valore predefinito \u00e8 false]";
