    t[7284] = "The data gathered is quantized over a 1 minute period, so should just be used as an estimate.";
    t[7285] = "I dati raccoli sono quantizzati su un intervallo di 1 minuto, quindi dovrebbero essere usati semplicemente come stima.";
    t[7292] = "When set to true, I2P runs without network connectivity, which is helpful if you are constantly restarting the router to test code updates as this prevents network disruption.";
    t[7293] = "Quando impostato su true, I2P viene eseguito senza connettivit\u00e0 di rete, il che \u00e8 utile se si riavvia costantemente il router per testare gli aggiornamenti del codice in quanto ci\u00f2 impedisce l'interruzione della rete.";
    t[7302] = "Updating IP address";
    t[7303] = "Aggiornamento dell'indirizzo IP";
    t[7308] = "SSU [IPv6 Only] with Introducers";
    t[7309] = "IPv6 solo SSU, introduttori";
    t[7312] = "SSU (Secure Semi-reliable UDP) is an I2P network transport providing encrypted, connection-oriented, point-to-point connections, in addition to IP address detection and NAT traversal services. For more information, see the <a href=https://geti2p.net/en/docs/transport/ssu class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7313] = "SSU (Secure Semi-reliable UDP) \u00e8 un trasporto di rete I2P che fornisce connessioni crittografate, orientate alla connessione, punto a punto, oltre a servizi di rilevamento degli indirizzi IP e attraversamento NAT. Per ulteriori informazioni, consultare la <a href=https://geti2p.net/en/docs/transport/ssu class='sitelink external' target=_blank rel=noreferrer>documentazione online</a>.";
    t[7314] = "Congestion window";
    t[7315] = "Finestra di congestione";
    t[7326] = "Use Proxy to Reseed";
    t[7327] = "Usa un proxy per il Reseed";
    t[7328] = "Until the advent of I2P integration in <a href=http://www.vuze.com/ target=_blank rel=noreferrer class='sitelink external'>Vuze</a>, it wasn't possible to download torrents that weren't hosted on the I2P network. However, now that Vuze (and latterly <a href=https://www.biglybt.com/ target=_blank rel=noreferrer class='sitelink external'>Bigly</a>) allow users to share non-I2P torrents on I2P, non-I2P torrents can be downloaded over I2P if Vuze/Bigly users have chosen to make content available to the I2P network. Popular torrents with a large number of peers are more likely to be accessible via I2P; to determine if the content is available, add the torrent link, magnet or infohash to your I2P-enabled BitTorrent client.";
    t[7329] = "Fino all'avvento dell'integrazione di I2P in <a href=http://www.vuze.com/ target=_blank rel=noreferrer class='sitelink external'>Vuze</a>, non era possibile scaricare torrent che non fossero ospitati sulla rete I2P. Tuttavia, ora che Vuze (e successivamente <a href=https://www.biglybt.com/ target=_blank rel=noreferrer class='sitelink external'>Bigly</a>) consentono agli utenti di condividere torrent non-I2P su I2P, i torrent non-I2P possono essere scaricati tramite I2P se gli utenti di Vuze/Bigly hanno scelto di rendere i contenuti disponibili alla rete I2P. I torrent popolari con un gran numero di peer sono pi\u00f9 probabili di essere accessibili tramite I2P; per verificare se il contenuto \u00e8 disponibile, aggiungi il link del torrent, il magnet o l'infohash al tuo client BitTorrent abilitato per I2P.";
