    t[7428] = "This setting (in hours) determines how old a RouterInfo in the NetDb is (its last known publication date) before it's classified as stale and deleted. [Default is 28 hours unless the router is a Floodfill, in which case the default is 8 hours]";
    t[7429] = "Questa impostazione (in ore) determina da quanto tempo \u00e8 vecchia una RouterInfo nel NetDb (la sua ultima data di pubblicazione nota) prima che venga definita obsoleta ed eliminata. [Il predefinito \u00e8 di 28 ore a meno che il router sia un Floodfill, in tal caso il predefinito \u00e8 di 8 ore]";
