    t[7443] = "Aiuto del router e FAQ";
    t[7444] = "If a <i>Registration Authentication</i> string is requested, you can find it on the <a href='http://127.0.0.1:7657/i2ptunnel/register?tunnel=3'>Registration Authentication page</a> linked from the <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>. Registration authentication ensures only the owner is able to register or otherwise manage the hostname, and is required on stats.i2p and reg.i2p.";
    t[7445] = "Se viene richiesta una stringa di <i>Autenticazione Registrazione</i>, la puoi trovare sulla <a href='http://127.0.0.1:7657/i2ptunnel/register?tunnel=3'>Pagina di Autenticazione Registrazione</a> collegata dalla <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Pagina di Configurazione del Gestore del Tunnel</a>. L'autenticazione della registrazione garantisce che solo il proprietario sia in grado di registrare o gestire l'hostname e richiesta su stats.i2p e reg.i2p.";
    t[7448] = "News &amp; Updates";
    t[7449] = "News &amp; Aggiornamenti";
    t[7452] = "[Linux/Unix/Solaris] If you can't start the router with <code>i2p/i2prouter start</code> try the <code>runplain.sh</code> script in the same directory. Root privileges are never required to run I2P+. If you need to compile the <a href=http://i2p-projekt.i2p/jbigi.html target=_blank rel=noreferrer>jBigi library</a> (which is necessary in rare cases), consult the documentation, visit the forums, or visit <a href=irc://127.0.0.1:6668/saltR class=chatlink>the I2P+ channel</a> or <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>IRC developer channel</a>.";
    t[7453] = "[Linux/Unix/Solaris] Se non riesci ad avviare il router con <code>i2p/i2prouter start</code>, prova lo script <code>runplain.sh</code> nella stessa directory. I privilegi di root non sono mai richiesti per eseguire I2P+. Se \u00e8 necessario compilare la libreria <a href=http://i2p-projekt.i2p/jbigi.html target=_blank rel=noreferrer>jBigi</a> (che \u00e8 necessaria in casi rari), consulta la documentazione, visita i forum o entra nella <a href=irc://127.0.0.1:6668/saltR class=chatlink>chat I2P+</a> o nel <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>canale degli sviluppatori IRC</a>.";
    t[7454] = "Top 50 peers by transit tunnel requests";
