    t[7458] = "Information defining the unique identity of a router on the network which includes its IP address (or the IP addresses of intermediate introducers) and listening port, public signing and encryption keys. Router identities correlate to peers in the NetDB. Also referred to as a <i>RouterInfo</i>.";
    t[7459] = "Informazioni che definiscono l'identit\u00e0 unica di un router nella rete, che include il suo indirizzo IP (o gli indirizzi IP degli intermediarsi introducenti) e la porta di ascolto, le chiavi di firma e di crittografia pubbliche. Le identit\u00e0 del router si correlano ai peer nella NetDB. Vengono anche chiamate <i>RouterInfo</i>.";
