    t[7690] = "A distributed database containing router contact information (RouterInfos) and destination contact information (LeaseSets). A single router maintains its own (partial) database for communicating with other routers on the network; no single router will maintain a list of all routers. The RouterInfos are stored on disk and read into memory when the router starts, or when new RouterInfos are acquired. Also referred to as the <i>NetDb</i>. For more information, see the <a href=https://geti2p.net/en/docs/how/network-database class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7691] = "Un database distribuito contenente informazioni di contatto del router (RouterInfos) ed informazioni di contatto di destinazione (LeaseSets). Un singolo router mantiene il proprio database (parziale) per comunicare con altri router sulla rete; nessun singolo router manterr\u00e0 un elenco di tutti i router. Le RouterInfos sono archiviate su disco e lette in memoria quando il router viene avviato o quando vengono acquisite nuove RouterInfos. Noto anche come <i>NetDb</i>. Per ulteriori informazioni, vedere la <a href=https://geti2p.net/en/docs/how/network-database class='sitelink external' target=_blank rel=noreferrer>documentazione online</a>.";
    t[7692] = "Address";
    t[7693] = "Indirizzo";
    t[7694] = "A threshold is defined by the number of connection attempts a remote destination is permitted to perform over a specified number of seconds before a \"breach\" occurs.";
    t[7695] = "Una soglia \u00e8 definita dal numero di tentativi di connessione che una destinazione remota \u00e8 autorizzata a compiere in un numero specificato di secondi prima che si produca una \"violazione\".";
    t[7704] = "Clearnet normally refers to the publicly accessible internet, the opposite of the darknet that typically describes the encrypted, anonymous services built on I2P, Tor etc. For more information, see the <a href=https://en.wikipedia.org/wiki/Clearnet_(networking) class='sitelink external' target=_blank rel=noreferrer>Wikipedia article</a>.";
    t[7705] = "Clearnet si riferisce normalmente all'internet accessibile pubblicamente, l'opposto del darknet che di solito descrive i servizi criptati e anonimi costruiti su I2P, Tor ecc. Per ulteriori informazioni, consultare l'<a href=https://en.wikipedia.org/wiki/Clearnet_(networking) class='sitelink external' target=_blank rel=noreferrer>articolo di Wikipedia</a>.";
