    t[7818] = "Defines the maximum number of parallel <a href=/jobs>jobs</a> that can be run. The default value is determined by the amount of memory allocated to the JVM via <code>wrapper.config</code>, and is set at 3 for less than 64MB, 4 for less than 256M, or 5 for more than 256MB. Note: A change to this setting requires a restart of the router.";
    t[7819] = "Definisce il numero massimo di <a href=/jobs>lavori</a> paralleli che possono essere eseguiti. Il valore predefinito \u00e8 determinato dalla quantit\u00e0 di memoria allocata alla JVM tramite <code>wrapper.config</code>, ed \u00e8 impostato a 3 per meno di 64 MB, 4 per meno di 256 MB o 5 per pi\u00f9 di 256 MB. Nota: una modifica a questa impostazione richiede un riavvio del router.";
