    t[7990] = "A router on the network tasked with providing and receiving information about other routers and services on the network. The current minimum share bandwidth for a router to be considered as capable of performing floodfill duties is 128 KBytes/sec, though it's possible to override this requirement and force a router to be a floodfill on the <a href=/configadvanced>Advanced Configuration page</a>. For more information, see the <a href=https://geti2p.net/en/docs/how/network-database#floodfill class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7991] = "Un router sulla rete incaricato di fornire e ricevere informazioni su altri router e servizi sulla rete. La larghezza di banda minima attuale per considerare un router capace di svolgere le funzioni di floodfill \u00e8 di 128 KBytes/sec, anche se \u00e8 possibile ignorare questo requisito e forzare un router ad essere un floodfill nella <a href=/configadvanced>pagina Configurazione Avanzata</a>. Per maggiori informazioni, consultare la <a href=https://geti2p.net/en/docs/how/network-database#floodfill class='sitelink external' target=_blank rel=noreferrer>documentazione online</a>.";
