    t[8208] = "Wherever possible, assets that are used repeatedly on your site should be loaded from an external file and not inlined. If you're using the same CSS on several pages, create a separate css file and load that in the <code>&lt;head&gt;</code> section of your pages. This will make styling updates to your site easier to manage, and will also allow the file to be cached in the visitor's browser, resulting in less bandwidth demands on your webserver and faster page loads for your visitors.";
    t[8209] = "Ovunque possibile, le risorse utilizzate ripetutamente sul tuo sito dovrebbero essere caricate da un file esterno e non in linea. Se stai utilizzando lo stesso CSS su diverse pagine, crea un file CSS separato e caricalo nella sezione <code>&lt;head&gt;</code> delle pagine. Ci\u00f2 faciliter\u00e0 la gestione degli aggiornamenti di stile del tuo sito e consentir\u00e0 anche al file di essere memorizzato nella cache del browser del visitatore, riducendo cos\u00ec le richieste di larghezza di banda sul tuo webserver e velocizzando il caricamento delle pagine per i visitatori.";
