    t[8256] = "Configuring I2P+: Network, Firefox, Tunnel Manager";
    t[8257] = "Configurazione di I2P+: Rete, Firefox, Tunnel Manager";
    t[8258] = "If you think you have opened up your firewall and I2P still thinks you are firewalled, remember that you may have multiple firewalls, for example both software packages and external hardware routers.";
    t[8259] = "Se pensi di aver aperto il tuo firewall e I2P crede ancora che sia chiuso, ricorda che potresti avere firewall multipli, ad esempio sia software che router hardware esterni.";
    t[8270] = "The keyword <i class=example>deny</i>. This threshold is always breached, i.e. no connection attempts will be allowed.";
    t[8271] = "La parola chiave <i class=example>deny</i>. Questa soglia viene sempre violata, cio\u00e8 non saranno consentiti tentativi di connessione.";
    t[8282] = "log visitors making 90 or more connections a minute";
    t[8283] = "registra i visitatori che effettuano 90 connessioni o pi\u00f9 al minuto";
    t[8286] = "You have configured inbound TCP, however your UDP port is firewalled, and therefore it is likely that your TCP port is firewalled as well.";
    t[8287] = "Hai configurato il TCP in ingresso, tuttavia la tua porta UDP \u00e8 dietro ad un firewall e di conseguenza \u00e8 probabile che anche la tua porta TCP ne sia dietro.";
    t[8296] = "This is the number of peers your router will use for network database inquiries. These are usually the <i>floodfill</i> routers which are responsible for maintaining network integrity. Your well integrated peers are shown on the bottom of the <a href='/profiles'>Profiles page</a>.";
    t[8297] = "Questo \u00e8 il numero di peer che il tuo router utilizzer\u00e0 per le richieste del database di rete. Di solito si tratta dei router <i>floodfill</i> responsabili del mantenimento dell'integrit\u00e0 di rete. I tuoi peer ben integrati sono mostrati in fondo alla <a href='/profiles'>pagina Profili</a>.";
    t[8298] = "Manage Router webapps";
    t[8299] = "Gestisci webapps del router";
    t[8302] = "Outbound TCP from random high ports to arbitrary remote TCP ports.";
    t[8303] = "TCP in uscita da porte casuali ad altre porte TCP remote arbitrarie.";
    t[8310] = "When you start I2P, it may take a few minutes to bootstrap (integrate) your router into the network and find additional peers, so please be patient.";
    t[8311] = "Quando tu avvii I2P, potrebbero essere necessari alcuni minuti per il bootstrap (integrazione) del tuo router nella rete e per trovare altri peer, perfavore sii paziente.";
    t[8318] = "No file specified. Please select a valid .zip or .su3 file to reseed from.";
    t[8319] = "Nessun file specificato. Seleziona un valido file .zip o .su3 per il reseed.";
    t[8320] = "Enable Universal Plug and Play (UPnP)";
    t[8321] = "Abilita Universal Plug and Play (UPnP)";
