    t[8332] = "Messages sent to peer";
    t[8333] = "Messaggi inviati al peer";
    t[8334] = "Function";
    t[8335] = "Funzione";
    t[8336] = "On the I2P network, remotely hosted services can be accessed using a <a href=https://en.wikipedia.org/wiki/Base32 target=_blank rel=noreferrer class='sitelink external'>Base32</a> address ending in \".b32.i2p\", a <i>destination</i> represented as a long <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external'>Base64</a> string, or more usually by using an .i2p domain. A destination is I2P's equivalent to an IP address, and is shown on the <a href='/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>. You can share your b32.i2p address to allow others to access to your website until you've registered your own .i2p domain.";
    t[8337] = "Sulla rete I2P, i servizi ospitati in remoto possono essere acceduti utilizzando un indirizzo <a href=https://en.wikipedia.org/wiki/Base32 target=_blank rel=noreferrer class='sitelink external'>Base32</a> terminante con \".b32.i2p\", una <i>destination</i> rappresentata come una lunga stringa <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external'>Base64</a>, o pi\u00f9 comunemente utilizzando un dominio .i2p. Una destination \u00e8 l'equivalente I2P di un indirizzo IP ed \u00e8 mostrata sulla <a href='/i2ptunnel/edit?tunnel=3'>pagina di configurazione del Tunnel Manager</a>. Puoi condividere il tuo indirizzo b32.i2p per consentire ad altri di accedere al tuo sito web fino a quando non avrai registrato il tuo dominio .i2p.";
    t[8340] = "Computing-related tutorials";
