    t[8343] = "Errore {0}";
    t[8350] = "Enter the name and paste the destination into your <a href='/dns?book=router&amp;filter=none'>address book</a>. Click <i>Add</i> to save the new entry.";
    t[8351] = "Inserisci il nome e incolla la destinazione nel tuo <a href='/dns?book=router&amp;filter=none'>rubrica degli indirizzi</a>. Clicca su <i>Aggiungi</i> per salvare la nuova voce.";
    t[8358] = "Stats";
