    t[8410] = "To disable directory listings, find the entry for <code>org.eclipse.jetty.servlet.Default.dirAllowed</code> in the <code>base-context.xml</code> file, located in the <code>eepsite/contexts</code> folder (just above docroot folder), and change 'true' to 'false' immediately underneath. To apply the change immediately, stop and restart the <i>I2P Webserver</i> client on the <a href=/configclients>Client Configuration page</a>. You can also drop an empty <code>index.html</code> file in any exposed directory to suppress directory listings for that location.";
    t[8411] = "Per disabilitare le liste delle directory, individua la voce <code>org.eclipse.jetty.servlet.Default.dirAllowed</code> nel file <code>base-context.xml</code>, che si trova nella cartella <code>eepsite/contexts</code> (appena sopra la cartella docroot), e cambia 'true' in 'false' immediatamente al di sotto. Per applicare la modifica immediatamente, interrompi e riavvia il client del <i>Webserver I2P</i> sulla <a href=/configclients>pagina di configurazione del client</a>. Puoi anche inserire un file vuoto <code>index.html</code> in qualsiasi directory esposta per impedire l'elenco delle directory per quella posizione.";
