    t[9056] = "These are the local services provided by your router. They may be clients started through the <a href='/i2ptunnelmgr'>Tunnel Manager</a> or external programs connecting through SAM, BOB, or directly to I2CP. By default, most of your client services (mail, http proxy, IRC) will share the same set of tunnels and be listed as <i>Shared Clients</i> and <i>Shared Clients(DSA)</i>, which enhances anonymity by blending the traffic from all shared services, and reduces the overhead required to build and maintain tunnels. However, if you experience a tunnel failure, all your services will go offline at the same time, so in some scenarios you may wish to configure client services to use their own set of tunnels. This can be done by unchecking the <i>Share tunnels with other clients&hellip;</i> option listed under <i>Shared Clients</i> on the configuration page of the relevant client service in the Tunnel Manager, after which you will need to restart the client service from the <a href='/i2ptunnelmgr'>main Tunnel Manager page</a>.";
    t[9057] = "Questi sono i servizi locali forniti dal tuo router. Possono essere client avviati tramite il <a href='/i2ptunnelmgr'>Gestore di Tunnel</a> o programmi esterni che si connettono tramite SAM, BOB o direttamente a I2CP. Di default, la maggior parte dei tuoi servizi client (posta, proxy http, IRC) condivider\u00e0 lo stesso set di tunnel e sar\u00e0 elencato come <i>Client Condivisi</i> e <i>Client Condivisi(DSA)</i>, il che migliora l'anonimato mescolando il traffico di tutti i servizi condivisi e riduce l'overhead necessario per costruire e mantenere i tunnel. Tuttavia, se si verifica un errore del tunnel, tutti i tuoi servizi andranno offline contemporaneamente, quindi in alcuni scenari potresti desiderare di configurare i servizi client in modo che utilizzino il proprio set di tunnel. Ci\u00f2 pu\u00f2 essere fatto deselezionando l'opzione <i>Condividi tunnel con altri client&hellip;</i> elencata sotto <i>Client Condivisi</i> nella pagina di configurazione del servizio client rilevante nel Gestore di Tunnel, dopo di che dovrai riavviare il servizio client dalla <a href='/i2ptunnelmgr'>pagina principale del Gestore di Tunnel</a>.";
