    t[9240] = "A simple CGI application that takes a hostname as a parameter and returns a 301 redirect to the proper URL with a <code>?i2paddresshelper=key</code> string appended. The HTTP proxy will interpret the appended string and use the key as the actual destination. In addition, the proxy will cache the key so the address helper is not necessary until restart, and offer the option to add the resolved address to the addressbook.";
    t[9241] = "Una semplice applicazione CGI che prende un hostname come parametro e restituisce un reindirizzamento 301 all'URL corretto con una stringa <code>?i2paddresshelper=key</code> allegata. Il proxy HTTP interpreter\u00e0 la stringa allegata e utilizzer\u00e0 la chiave come destinazione reale. Inoltre, il proxy memorizzer\u00e0 nella cache la chiave in modo che l'helper di indirizzo non sia necessario fino al riavvio, e offrir\u00e0 l'opzione di aggiungere l'indirizzo risolto all'agenda.";
