    t[9326] = "The router's external port allows communication with other routers. It is recommended to configure your firewall to allow inbound and outbound traffic on this port to optimize your router's performance on the network.";
    t[9327] = "La porta esterna del router consente le comunicazioni con gli altri router. E' raccomandato di configurare il tuo firewall per consentire il traffico in entrata ed uscita su questa porta per ottimizzare le prestazioni del tuo router nella rete.";
