    t[9354] = "Reseeding is the bootstrapping process used to find other routers when you first install I2P, or when your router has too few router references remaining. The default settings will work for most people. Change these only if HTTPS is blocked by a restrictive firewall and reseed has failed.";
    t[9355] = "La risemina \u00e8 il processo di avvio utilizzato per trovare altri router quando si installa per la prima volta I2P, o quando il tuo router ha pochi riferimenti di router rimanenti. Le impostazioni predefinite funzionano per la maggior parte delle persone. Cambiale solo se HTTPS \u00e8 bloccato da un firewall restrittivo e la risemina non \u00e8 riuscita.";
    t[9362] = "This setting, when enabled, modifies the maximum additional random pong delay introduced for ping-enabled servers, if <code>i2p.streaming.enablePongDelay</code> is also enabled. Unless explicitly set, the default value of 50ms will be used.";
    t[9363] = "Questa impostazione, quando abilitata, modifica il massimo ritardo casuale aggiuntivo per pong introdotto per i server abilitati al ping, se anche <code>i2p.streaming.enablePongDelay</code> \u00e8 abilitato. Se non impostato esplicitamente, verr\u00e0 utilizzato il valore predefinito di 50ms.";
