    t[9630] = "Tunnels built by other routers through your router. This may vary widely depending on network demand, your shared bandwidth, and amount of locally-generated traffic. The recommended method for limiting participating tunnels is to change your share percentage on the <a  href='/config'>Bandwidth Configuration page</a>. You may also limit the total number by setting <code>router.maxParticipatingTunnels=nnn</code> on the <a href='/configadvanced'>Advanced configuration page</a>. <a href='/configstats#tunnel.participatingTunnels'>[Enable graphing]</a>.";
    t[9631] = "I tunnel costruiti da altri router tramite il tuo. Questo pu\u00f2 variare ampiamente a seconda della domanda di rete, della tua larghezza di banda condivisa e della quantit\u00e0 di traffico generato localmente. Il metodo consigliato per limitare la partecipazione ai tunnel \u00e8 quello di modificare la tua percentuale di condivisione sulla pagina <a  href='/config'>Configurazione larghezza di banda</a>. Puoi anche limitare il numero totale impostando <code>router.maxParticipatingTunnels=nnn</code> sulla pagina <a href='/configadvanced'>Configurazione avanzata</a>. <a href='/configstats#tunnel.participatingTunnels'>[Abilita il grafico]</a>.";
