    t[10038] = "To configure an alternative webserver for use on I2P, you can either use the existing webserver tunnel and <a href=/configclients>disable the default webserver</a> from running, or create a new HTTP Server tunnel in the <a href=/i2ptunnelmgr>Tunnel Manager</a>. Ensure that the webserver's <i>listening port</i> is also configured in the Tunnel Manager settings. For example, if your webserver is listening by default on address 127.0.0.1 port 80, you'd also need to ensure that the <i>Target port</i> in the Tunnel Manager settings page for the service is also configured to port 80.";
    t[10039] = "Per configurare un webserver alternativo da utilizzare su I2P, puoi utilizzare il tunnel del webserver esistente e <a href=/configclients>disabilitare il webserver predefinito</a> oppure creare un nuovo tunnel del server HTTP nel <a href=/i2ptunnelmgr>Gestore tunnel</a>. Accertati che anche la <i>porta di ascolto</i> del webserver sia configurata nelle impostazioni del Gestore tunnel. Ad esempio, se il tuo webserver ascolta per impostazione predefinita sull'indirizzo 127.0.0.1 porta 80, devi anche assicurarti che anche la <i>porta di destinazione</i> nella pagina delle impostazioni del Gestore tunnel per il servizio sia configurata sulla porta 80.";
