    t[10046] = "An I2P router usually only needs to be seeded once, to join the network for the first time. However, if the router is running for an extended period without network connectivity it may also need to be reseeded. Reseeding involves fetching multiple \"RouterInfo\" files (bundled into a signed zip-file) from at least two predefined server URLs picked from a volunteer-run group of clearnet HTTPS servers.";
    t[10047] = "Un router I2P generalmente necessita di essere inizializzato solo una volta, per entrare in rete. Ma, se il router sta girando per un lungo periodo senza connettivit\u00e0 di rete \u00e8 possibile che necessiti del reseed. Il reseed comporta il recupero di file multipli \"RouterInfo\" (incorporati in un file zip firmato) da almeno due URL predefiniti presi da un gruppo di server HTTPS di internet di volontari.";
