    t[10076] = "A list of countries derived from the <a href=https://freedomhouse.org/report/countries-world-freedom-2019 class='sitelink external' target=_blank rel=noreferrer>World Freedom Report</a> with a poor civil liberties reputation. This list is used to place routers running in the specified countries in <i>Hidden Mode</i> to provide enhanced security for users. The following countries are designated as strict: Afghanistan, Azerbaijan, Bahrain, Belarus, Brunei, Burundi, Cameroon, Central African Republic, Chad, China, Cuba, Democratic Republic of the Congo, Egypt, Equatorial Guinea, Eritrea, Ethiopia, Iran, Kazakhstan, Laos, Libya, Myanmar, North Korea, Palestinian Territories, Rwanda, Saudi Arabia, Somalia, South Sudan, Sudan, Eswatini (Swaziland), Syria, Tajikistan, Thailand, Turkey, Turkmenistan, Venezuela, United Arab Emirates, Uzbekistan, Western Sahara, Yemen.";
    t[10077] = "Un elenco di paesi derivato dal <a href=https://freedomhouse.org/report/countries-world-freedom-2019 class='sitelink external' target=_blank rel=noreferrer>World Freedom Report</a> con una scarsa reputazione per le libert\u00e0 civili. Questo elenco viene utilizzato per collocare i router che operano nei paesi specificati in <i>Modalit\u00e0 Nascosta</i> per garantire una maggiore sicurezza agli utenti. I seguenti paesi sono designati come severi: Afghanistan, Azerbaigian, Bahrain, Bielorussia, Brunei, Burundi, Camerun, Repubblica Centrafricana, Ciad, Cina, Cuba, Repubblica Democratica del Congo, Egitto, Guinea Equatoriale, Eritrea, Etiopia, Iran, Kazakistan, Laos, Libia, Myanmar, Corea del Nord, Territori Palestinesi, Ruanda, Arabia Saudita, Somalia, Sudan del Sud, Sudan, Eswatini (Swaziland), Siria, Tagikistan, Thailandia, Turchia, Turkmenistan, Venezuela, Emirati Arabi Uniti, Uzbekistan, Sahara Occidentale, Yemen.";
