    t[10318] = "Where possible, please ensure I2P+/Java is allowed bi-directional port access from the internet by configuring your modem/router/pc firewall accordingly. If you're behind a prohibitive firewall but have unrestricted outbound access, I2P+ can still function; you can turn off inbound access and rely on <a href=http://i2p-projekt.i2p/udp.html target=_blank rel=noreferrer class=sitelink>SSU IP Address Detection</a> (<a href=https://wikipedia.org/wiki/Hole_punching target=_blank rel=noreferrer class='sitelink external'>firewall hole punching</a>) to connect you to the network, and your network status in the side panel will indicate \"Status: Firewalled\". For optimal performance, please ensure I2P's <a href=/confignet#udpconfig>external port</a> is visible from the internet (see below for more information).";
    t[10319] = "Se possibile, assicurati che I2P+/Java abbia accesso bidirezionale alle porte dal tuo modem/router/firewall pc, configurandole opportunamente. Se sei dietro un firewall restrittivo ma hai accesso in uscita illimitato, I2P+ pu\u00f2 ancora funzionare; puoi disattivare l'accesso in ingresso e fare affidamento sulla <a href=http://i2p-projekt.i2p/udp.html target=_blank rel=noreferrer class=sitelink>Rilevazione dell'indirizzo IP SSU</a> (<a href=https://wikipedia.org/wiki/Hole_punching target=_blank rel=noreferrer class='sitelink external'>firewall hole punching</a>) per connetterti alla rete e lo stato della tua rete nel pannello laterale indicher\u00e0 \"Stato: Firewall\". Per prestazioni ottimali, assicurati che la <a href=/confignet#udpconfig>porta esterna</a> di I2P sia visibile da internet (vedi sotto per ulteriori informazioni).";
