    t[10651] = "Pacchetti duplicati ricevuti dal peer";
    t[10660] = "Services may be hosted on multiple routers simultaneously, by sharing the same private key for the destination. Multihoming can further enhance the security and stability of a server by providing redundancy; if a server is multihomed, when a server in the pool goes offline, the provided service will remain available, making it more difficult to correlate server downtime with a router going offline.";
    t[10661] = "I servizi possono essere ospitati contemporaneamente su pi\u00f9 router, condividendo la stessa chiave privata per la destinazione. Il multihoming pu\u00f2 ulteriormente migliorare la sicurezza e la stabilit\u00e0 di un server fornendo ridondanza; se un server \u00e8 multihomed, quando un server del pool va offline, il servizio fornito rimarr\u00e0 disponibile, rendendo pi\u00f9 difficile correlare l'interruzione del server con un router che va offline.";
    t[10672] = "Client Configuration";
    t[10673] = "Configurazione client";
    t[10674] = "Ensure your Java is up to date. Version 1.8 or higher is required; version 11 or higher is recommended. Check your Java version at the top of <a href=/info>the router information page</a>.";
    t[10675] = "Assicurati che Java sia aggiornato. La versione 1.8 o superiore \u00e8 richiesta; si consiglia la versione 11 o superiore. Verifica la tua versione di Java nella parte superiore della <a href=/info>pagina delle informazioni del router</a>.";
