    t[10710] = "The process of acquiring router identities, normally via <i>clearnet</i> servers, to ensure your router can communicate and build tunnels with other routers on the network. When a router has no router identities for other peers (usually immediately after installation), the process of reseeding is also referred to as <i>bootstrapping</i>.";
    t[10711] = "Il processo di acquisizione delle identit\u00e0 dei router, di solito tramite server <i>clearnet</i>, per garantire che il tuo router possa comunicare e costruire tunnel con altri router sulla rete. Quando un router non ha identit\u00e0 di router per altri peer (di solito immediatamente dopo l'installazione), il processo di reimmissione viene chiamato anche <i>bootstrapping</i>.";
