    t[10746] = "A tunnel used by the router for communicating with other routers to perform various \"housekeeping\" functions such as learning and publishing <i>leasesets</i>, testing client tunnels, and learning about and validating other routers in the network. These tunnels are normally low-bandwidth.";
    t[10747] = "Un tunnel utilizzato dal router per comunicare con altri router per eseguire varie funzioni di \"mantenimento\" come apprendere e pubblicare <i>leasesets</i>, testare tunnel di client e apprendere e convalidare altri router nella rete. Questi tunnel sono normalmente a bassa larghezza di banda.";
