    t[11024] = "By default, I2P will use the system configured default browser to launch at startup. If you wish to nominate an alternative browser, you will need to edit your router.config file (or the <a href=/configadvanced>Advanced Configuration page</a> if you have enabled advanced console mode) and add a new configuration line <code>routerconsole.browser=/path/to/browser</code> or <code>routerconsole.browser=\\path\\to\\browser.exe</code> if using Windows, replacing <code>\\path\\to\\browser</code> with the location of the browser you wish to use. Note: If the path to your chosen browser contains spaces, you may need to encase the path in quotes e.g. <code>routerconsole.browser=\"C:\\Program Files\\Mozilla\\Firefox.exe\"</code>";
    t[11025] = "Per impostazione predefinita, I2P utilizzer\u00e0 il browser predefinito configurato di sistema per avviarsi all'avvio. Se desideri nominare un browser alternativo, dovrai modificare il file router.config (o la <a href=/configadvanced>pagina di configurazione avanzata</a> se hai abilitato la modalit\u00e0 console avanzata) e aggiungere una nuova riga di configurazione <code>routerconsole.browser=/percorso/al/browser</code> o <code>routerconsole.browser=\\percorso\\al\\browser.exe</code> se stai usando Windows, sostituendo <code>\\percorso\\al\\browser</code> con la posizione del browser che vuoi utilizzare. Nota: se il percorso del browser scelto contiene spazi, potresti dover racchiudere il percorso tra virgolette ad esempio <code>routerconsole.browser=\"C:\\Program Files\\Mozilla\\Firefox.exe\"</code>";
