    t[11106] = "This setting (in hours) allows you to manually configure how old a RouterInfo is in order for it to be checked by the Refresh Routers Job. By default, the age of a RouterInfo before a refresh is intitiated scales according to the size of the NetDb, increasing as the NetDb grows in size. A value of 0 will force the Router Refresh Job to check every router in the NetDb, regardless of age.";
    t[11107] = "Questa impostazione (in ore) consente di configurare manualmente l'et\u00e0 di un RouterInfo affinch\u00e9 venga controllato dal job Refresh Routers. Per impostazione predefinita, l'et\u00e0 di un RouterInfo prima di un aggiornamento scala in base alla dimensione di NetDb, aumentando all'aumentare della dimensione di NetDb. Un valore di 0 forzer\u00e0 il job Refresh Routers a controllare ogni router in NetDb, indipendentemente dall'et\u00e0.";
