    t[11128] = "An I2P web application that manages service destinations for the network, mapping B64 hashes to human-readable names. Destinations may be added manually, or via subscriptions to hosts.txt files. Also referred to as SusiDNS. For more information, see the <a href=https://geti2p.net/en/docs/naming class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[11129] = "Un'applicazione web I2P che gestisce le destinazioni del servizio per la rete, mappando gli hash B64 in nomi leggibili dall'uomo. Le destinazioni possono essere aggiunte manualmente o tramite sottoscrizioni a file hosts.txt. Conosciuta anche come SusiDNS. Per ulteriori informazioni, consultare la <a href=https://geti2p.net/en/docs/naming class='sitelink external' target=_blank rel=noreferrer>documentazione online</a>.";
