    t[11658] = "Your modem or router may support <a href=https://wikipedia.org/wiki/Universal_Plug_and_Play target=_blank rel=noreferrer>Universal Plug &amp; Play</a> (UPnP), which permits automatic port forwarding. Ensure UPnP support for I2P+ is enabled on the <a href=/confignet>config page</a>, then try to activate UPnP on your modem/router and possibly your computer also. Now try restarting the <a href=/>I2P+ router</a>. If successful, I2P+ should report \"Status: OK\" in the side panel once the I2P+ router completes initial connectivity tests.";
    t[11659] = "Il tuo modem o router potrebbe supportare <a href=https://wikipedia.org/wiki/Universal_Plug_and_Play target=_blank rel=noreferrer>Universal Plug &amp; Play</a> (UPnP), che consente il forwarding automatico delle porte. Assicurati che il supporto UPnP per I2P+ sia abilitato sulla <a href=/confignet>pagina di configurazione</a>, quindi prova ad attivare UPnP anche sul tuo modem/router e, eventualmente, sul tuo computer. Ora prova a riavviare il <a href=/>router I2P+</a>. Se ha successo, I2P+ dovrebbe segnalare \"Status: OK\" nel pannello laterale una volta che il router I2P+ ha completato i test di connettivit\u00e0 iniziali.";
