    t[12026] = "I2P FAQ";
    t[12027] = "FAQ DI I2P";
    t[12028] = "If you hover over the <i>Router Info</i> heading, your truncated router identity will be shown (the first four characters (24 bits) of your 44-character (256-bit) Base64 router hash). The full hash is shown on your <a href='netdb?r=.'>Network Database entry</a>. Never reveal this to anyone, as your router identity is uniquely linked to your IP address in the network database.";
    t[12029] = "Se si passa il mouse sopra l'intestazione <i>Router Info</i> viene mostrata la tua identit\u00e0 del router troncata (i primi quattro caratteri (24 bit) dell'hash Base64 del router di 44 caratteri (256 bit). L'hash completo \u00e8 mostrato sulla tua <a href='netdb?r=.'>scheda del database di rete</a>. Non rivelarlo mai a nessuno, poich\u00e9 l'identit\u00e0 del router \u00e8 univocamente collegata al tuo indirizzo IP nel database di rete.";
