    t[12038] = "Directory listings (sometimes referred to as virtual directories) are enabled by default, so you can host files from a sub-directory of <code>docroot</code> without providing a page with links to the files. You can also serve content that exists outside of <code>docroot</code> by using a <a href=https://en.wikipedia.org/wiki/Symbolic_link target=_blank rel=noreferrer class='sitelink external'>symbolic link</a> to the desired directory.";
    t[12039] = "Le liste delle directory (talvolta dette directory virtuali) sono abilitate per impostazione predefinita, quindi \u00e8 possibile ospitare file da una sottodirectory di <code>docroot</code> senza fornire una pagina con collegamenti ai file. \u00c8 anche possibile servire contenuti che si trovano al di fuori di <code>docroot</code> utilizzando un <a href=https://en.wikipedia.org/wiki/Symbolic_link target=_blank rel=noreferrer class='sitelink external'>link simbolico</a> alla directory desiderata.";
